import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { AppComponent } from './app.component';
import { AppRoutingModule } from './app-routing.module';  // Importation du module de routage
import { AdminModule } from './components/admin/admin.module';  // Importation du module Admin
// import { UtilisateurModule } from './components/utlisateur/utilisateur.module';
import { NotFoundComponent } from './not-found/not-found.component';  // Importation du module Utilisateur
import { AccueilComponent } from './components/utlisateur/accueil/accueil.component';

@NgModule({
  declarations: [
    AppComponent,
    NotFoundComponent,
    AccueilComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    AdminModule,  // Importation du module Admin
    // UtilisateurModule  // Importation du module Utilisateur
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
